                    axisHighlight={{
                        x: "line", 
                        y: "none",
                      }}
                    xAxis={[{ data: minutes,
                        min: minutes[0],
                        max: minutes[minutes.length-1],
                        hideTooltip: true  }]}
                    series={[
                        {
                            data: values,
                            // type: "line",
                            area: true,
                            stack: "total",
                            showMark: false,
                            color: props.colorData?.home
                        },
                    ]}
                    // width={100}
                    // height={200}
                    leftAxis={null}
                    bottomAxis={null}
                />
